        return new Source("<!DOCTYPE html>
<html lang=\"en\">
<head>
    <title>Log    In</title>
    <meta charset=\"utf-8\">
    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">
    <title>LogIn Form</title>
    {% include 'includes/head.html.twig' %}
    {% include 'includes/header.html.twig' %}

    {% block body %}

    <h1 style=\"margin-top: 150px\">Please sign in</h1>
    <form method=\"post\" >
        {# If there's any error, display it to the user #}
        {% if error %}
            <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
        {% endif %}

        <label for=\"inputEmail\" class=\"sr-only\">Email</label>
        <input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\"
               placeholder=\"Email\" required autofocus>
        <label for=\"inputPassword\" class=\"sr-only\">Password</label>
        <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" placeholder=\"Password\" required>
        <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\"/>

        <button type=\"submit\">
            Sign in
        </button>
    </form>
{% endblock %}", "security/login.html.twig", "/var/www/personal-vk-account.ru/templates/security/login.html.twig");
